function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;
	消弹属性.强力 = true;
	if (反弹)
	{
		消弹属性.反弹 = true;
	}
	_root.消除子弹(消弹属性);
}
_parent.UpdateSmallState("见切开始");

// 粉碎切割入口：初始化计数或检查上限
if (typeof 见切后撤次数 == "undefined")
{
    见切后撤次数 = 1;  // ← 首次进入时初始化为1
}
else if (见切后撤次数 >= 2)
{
    // 派生已达2次上限，不能继续派生
    _parent.动画完毕();  // ← 直接结束动画
}
else
{
    // 第2、3次派生，自增计数
    见切后撤次数 += 1;  // ← 继续派生
}

//_parent.动画完毕();
if (_parent._name == _root.控制目标 && _parent.动作C)
{
		gotoAndPlay("特殊纳刀");
}

_parent.UpdateSmallState("见切追斩中");

// 见切后撤结束，重置派生计数以便下次重新进入时能再派生3次
见切后撤次数 = undefined;  // ← 清零计数

onClipEvent (enterFrame) {
   //_parent.攻击时斜向移动(-20,-25);
   _parent.攻击时移动(-40,-45);
}

onClipEvent (enterFrame) {
   //_parent.攻击时斜向移动(-20,-25);
   _parent.攻击时移动(60,80);
}

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{		
		/*
		if(自机.动作C)//R
		{_parent.gotoAndPlay("见切");}
		if (自机.动作A && !(自机.上行 || 自机.下行 || 自机.左行 || 自机.右行))
		{_parent.gotoAndPlay("见切追斩");}
		*/
		_parent.见切可派生();
	}
}
/*
